import React from 'react';
import "./Board.css";

const post = [
    {
    'id':1,
    'title':"1 Post",
    'content':"내용1",
    'writer' : "김태훈",
    'date' : Date.now
  },
  {
    'id':2,
    'title':"2 Post",
    'content':"내용2",
    'writer' : "개탱",
    'date' : Date.now
  },
  {
    'id':3,
    'title':"3 Post",
    'content':"내용3",
    'writer' : "탱탱",
    'date' : Date.now
  },
]
  
function Board() {
    return (
        <div>
            <PostList />
        </div>
    )
}



function PostList() {
    return (
        <div>
            
            <PostView id={post[0].id} title={post[0].title} content={post[0].content} writer={post[0].writer} date={post[0].date} />
        </div>
    )
}

function PostView(props) {
    return(
        <div>
            <h2>{props.id}</h2>
            <h2>{props.title}</h2>
            <h2>{props.content}</h2>
            <h2>{props.writer}</h2>
            <h2>{props.date}</h2>
        </div>
    )
}



export default Board;
